История развития завода начинается с 1893 года, когда помещику Ефимову было пожа­ловано 500 квад­рат­ных метров земли, на которой он и основал меха­ничес­кие мастерские. В них изготав­лива­лись фигур­ные ограды, кон­ные плуги, ручные соломо­резки и другие изделия. 
После 1920 года предприятие реконс­труиро­вали и освоили выпуск дерево­обраба­тываю­щего обору­дова­ния, прессов для штам­повки гвоздей, силосо­резки, пневма­тичес­ких молотов. 

В 1926 году, на базе производственных строений, был открыт механический завод, который производил различное литье. В 1930 году заводу было присвоено имя Ф.Э. Дзержинского. 

Городокский станкостроительный завод им. Дзержинского специализировался на выпуске деревообрабатывающего оборудования и автоматических линий по выпуску столярно-строительных изделий. 

Завод неоднократно являлся участником международных выставок и ярмарок. Так, в 1977 году завод представлял свою продукцию в Бухаресте на международной выставке «Техноэкспонат». В 1979 завод награжден Почетным дипломом Президиума Торгово-промышленной палаты СССР за участие в международной выставке «Лесдревмаш-79». В 1980 году завод являлся участником выставки-распродажи деревообрабатывающего оборудования в г. Салоники (Греция). Продукция завода поставлялась в 30 стран мира. 

В 2003 году на базе станкостроительного завода образовано ООО «Говер». Основной вид деятельности: производство деревообрабатывающего оборудования. 

Общая площадь завода составляет 11 га, производственные площади занимают 42,3 тыс.кв.м. На заводе в настоящее время работает 3 цеха основного производства и два вспомогательных цеха. В дальнейшем планируется расширение завода и наращивание объемов производства. 

Техническая оснащенность производства и применение передовых технологий в сочетании с мастерством рабочих и инженерно-технических работников дают возможность производить высококачественное деревообрабатывающее оборудование и осваивать новые высокопроизводительные станки, такие как четырехсторонний строгальный С16М-4У. 

В настоящее время предприятием выпускаются серийно и под заказ следующее деревообрабатывающее оборудование: 

станок четырехсторонний пятишпиндельный строгальный С16М-4У; 
станок комбинированный К40М-1; 
станок токарный ТП40-1; 
станок строгальный фуговально-рейсмусовый СФР-4; 
станок шипорезный ОК-058.12; 
станок фрезерно-шлифовальный ФШ; 
станок круглопалочный КПА50-2; 
станок рейсмусовый СР-4; 
станок токарный с копиром ТК-40; 
станок круглопильный Ц-40; 
станок многопильный ЦМ. 
Все модели станков прошли государственную аттестацию и имеют сертификаты соответствия.

ООО "Говер " также изготовляет под заказ сверлильно - пазовальный станок модели СВП-1 с горизонтальным размещением шпинделя.
